		"full_text": "\"헛소리는 진실이냐 거짓이냐를 가리는 게임에 아예 참여하지 않는다. 헛소리가 가장 중요시하는 미덕은 정확성이 아니라 진정성이다. 헛소리 치는 사람들은, \"세상을 정확히 표현하려고 노력하는 대신, 자기가 얼마나 진심인지를 보여주려고 애쓴다”고 프랭크퍼트는 말한다.\"",
